// Gehe durch alle Einträge in form_response.answers und extrahiere Fragen und Antworten
const answers = $json["form_response"]["answers"];
let output = {};

// Überprüfe, ob answers ein Objekt ist und iteriere durch die Schlüssel-Wert-Paare
for (const [key, value] of Object.entries(answers)) {
    let question = key; // Die Frage ist der Schlüssel
    let response;

    // Prüfe, ob die Antwort existiert und ob es ein Array, Objekt oder einfacher Wert ist
    if (Array.isArray(value)) {
        // Falls die Antwort ein Array ist, verbinde die Einträge zu einem String mit ", " als Trennzeichen
        response = value.join(", ");
    } else if (typeof value === "object" && value !== null) {
        // Falls die Antwort ein Objekt ist (z.B., für eine 'other'-Option), extrahiere den 'other'-Wert oder andere Unterwerte
        response = value.other ? String(value.other).replace(/,/g, " ") : JSON.stringify(value).replace(/,/g, " ");
    } else if (value !== undefined && value !== null) {
        // Falls die Antwort ein einfacher Wert ist, konvertiere ihn in einen String und ersetze alle Kommas
        response = String(value).replace(/,/g, " ");
    } else {
        // Falls keine Antwort vorhanden ist, setze einen Standardwert
        response = "Nicht verfügbar";
    }

    // Entferne doppelte Leerzeichen, falls sie vorhanden sind
    response = response.replace(/\s+/g, " ").trim();

    // Füge die Frage und Antwort als Schlüssel-Wert-Paar zum output-Objekt hinzu
    output[question] = response;
}

// Das Ergebnis als Objekt zurückgeben, damit n8n es verarbeiten kann
return [{ json: output }];

